import React from 'react';
import SectionTitle from '../section_title/section_title';
import './projects.css';
import Thumbnail from './thumbnail/thumbnail';

const project1 = {
  name: 'Sorting Algorithm Visualizer via Randomized Images',
  description: "Lumbersexual XOXO kinfolk keytar offal selfies tote bag iPhone, \
    narwhal health goth fashion axe farm-to-table bicycle rights church-key echo park. \
    Mixtape polaroid flannel, chartreuse gluten-free occupy VHS dreamcatcher godard.",
  gifPath: '/assets/sorting-gif.gif',
  icons: ['fab fa-python'],
  links: {
    linkName: 'testLinkName',
    linkHref: 'testLinkHref',
  }
}

class Projects extends React.Component {
  render() {
    return (
      <div className='projects section-wrapper' id='projects'>
        <SectionTitle sectionName='projects' />
        <div className="projects-main-section">
          <div className="thumbnails-wrapper">
            <Thumbnail className="thumbnail" {...project1} />
          </div>
        </div>
      </div>
    )
  }
}

export default Projects
